    def get_move_candidates(self, cropped_sight):
        center = (self._sight * self._sight) // 2
        return [ 
            cropped_sight[center - 1],
            cropped_sight[center - self._sight],
            cropped_sight[center + 1],
            cropped_sight[center + self._sight]
        ]
    
    def make_2d_input_map(self, input_map):
        # input to 2d amp
        result = [[0] * self._column for _ in range(self._row)]

        for r in range(self._row):
            result[r] = input_map[r*self._column:r*self._column+self._column ]

        return result

    def sample_pad_2d_input_map(self, map2d, position):
        column = len(map2d[0]) 
        row = len(map2d)
        pad = (self._sight//2)
        
        result = [[-1]*(column+(pad*2)) for _ in  range(row + (pad*2)) ]
        for r in range(row):
            result[r+pad][pad:-pad] = map2d[r]

        state = [
            result[i][position[1]:position[1]+self._sight] 
            for i in range(position[0],position[0]+self._sight)]

        return state

    def index_to_position(self, index):
        return [ index // self._column, index % self._column]

    def firstperson_view(self, state, index):
        position = self.index_to_position(index) # This is correct
        map2d = self.make_2d_input_map(state)
        sample_map = self.sample_pad_2d_input_map(map2d, position)

        return sample_map
    
    def calculate_radar_score(self, space, position):

        left = 0
        top_left = 0
        top = 0
        top_right = 0
        right = 0
        bottom_left = 0
        bottom = 0
        bottom_right = 0
        total = 0

        half_sight = self._sight // 2
        view_up = position[0] - half_sight
        view_down = position[0] + half_sight
        view_left = position[1] - half_sight
        view_right = position[1] + half_sight  


        for i in range(self._row):
            for j in range(self._column):
                value = space[i][j]
                if value <= 0 : continue
                total += value

                if i<view_up:                    
                    if j<view_left:
                        top_left += value                        
                    elif  j>=view_left and j<=view_right:
                        top += value                        
                    else:
                        top_right += value
                elif i>=view_up and i<=view_down:
                    if j<view_left:
                        left += value                        
                    elif  j>=view_left and j<=view_right:
                        pass
                    else:
                        right += value
                else:
                    if j<view_left:
                        bottom_left += value
                    elif  j>=view_left and j<=view_right:
                        bottom += value
                    else:
                        bottom_right += value
        scores = [left, top_left, top, top_right, right, bottom_right, bottom, bottom_left]
        out = [x*10/total for x in scores]

        return out
    
    def preprocess(self, state, index):

        position = self.index_to_position(index) # This is correct
        map2d = self.make_2d_input_map(state)
        radar_scores = self.calculate_radar_score(map2d, position)
        sample_map = self.sample_pad_2d_input_map(map2d, position)

        # Set Player Value -2
        sample_map[ self._sight//2][self._sight//2 ] = -2
        
        player_view = sum(sample_map,[])
        out = player_view + radar_scores # 81 + 4

        return out
